  return (
    <div>
        <div>{expense.date.toLocaleString('en-US', {month: 'long'})}</div>
        <div>{expense.date.toLocaleString('en-US', {day: '2-digit'})}</div>
        <div>{expense.date.getFullYear()}</div>
    </div>
  )
}

